import React from 'react'
import axios from "axios";
import './Task.css'
import react, { useEffect, useState } from "react";
import TaskEdit from '../../components/modals/TaskAdd';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
const Task = () => {
	function handleOnDragEnd(result) {
		if (!result.destination) return;
	
		const items = Array.from(characters);
		const [reorderedItem] = items.splice(result.source.index, 1);
		items.splice(result.destination.index, 0, reorderedItem);
	
		updateCharacters(items);
	  }
    const [users, setUsers] = useState([]);
    useEffect(() => {
      loadProduct();
    }, []);
  
    const loadProduct = async () => {
      await axios.get("http://localhost:3003/task").then((res) => {
        setUsers(res.data);
      });
    };
 
    const DeleteProduct = async (id) => {
      await axios.delete(`http://localhost:3003/task/${id}`);
      loadProduct();
      setAnchorEl(null);
    };
    const [anchorEl, setAnchorEl] = useState(null);
    const open = Boolean(anchorEl);
    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
      setAnchorEl(null);
    };
  return (
    
	<section id="content">	
	<main>
		<div class="head-title">
			<div class="left">
				<h1>Dashboard</h1>
				<ul class="breadcrumb">
					<li>
						<a href="#">Dashboard</a>
					</li>
					<li><i class='bx bx-chevron-right' ></i></li>
					<li>
						<a class="active" href="#">Home</a>
					</li>
				</ul>
			</div>
			<a href="#" class="btn-download">
				<i class='bx bxs-cloud-download' ></i>
				<span class="text">Download PDF</span>
			</a>
		</div>

		

		<div class="table-data">
			<div class="order">
				
				<div class="Tasker">
				<div class="head">
					<h3>Task <span style={{fontSize:"14px"}}>(in progress)</span></h3>
					<TaskEdit/>
					<i class='bx bx-filter' ></i>
				</div>
				
				<ul class="Tasker-list">
				<DragDropContext onDragEnd={handleOnDragEnd}>
          <Droppable droppableId="characters">
            {(provided) => (
              <ul className="characters" {...provided.droppableProps} ref={provided.innerRef}>
                {characters.map(({id, name, thumb}, index) => {
                  return (
                    <Draggable key={id} draggableId={id} index={index}>
                      {(provided) => (
                        <li ref={provided.innerRef} {...provided.draggableProps} {...provided.dragHandleProps}>
                          <div className="characters-thumb">
                            <img src={thumb} alt={`${name} Thumb`} />
                          </div>
                          <p>
                            { name }
                          </p>
                        </li>
                      )}
                    </Draggable>
                  );
                })}
                {provided.placeholder}
              </ul>
            )}
          </Droppable>
        </DragDropContext>
				</ul>
			</div>

	  
	
  
			</div>
			<div class="Tasker">
				<div class="head">
					<h3>Task<span style={{fontSize:"14px"}}>(completed)</span></h3>
					<i class='bx bx-plus' ></i>
					<i class='bx bx-filter' ></i>
				</div>
				<ul class="Tasker-list">
					<li class="completed">
						<p>Task</p>
						<i class='bx bx-dots-vertical-rounded' ></i>
					</li>
				</ul>
			</div>
		</div>
	</main>
</section>
  )
}

export default Task
